function Agendamentos({ agendamentos }) {

    return ( 
        <div>
                {agendamentos.map((agendamentos) => {
                    <li key={agendamentos.id}>
                        {agendamentos.Nome}, {agendamentos.Data}, {agendamentos.Descrição}, {agendamentos.Status} 
                    </li>
                })}
        </div>
    );
}

export default Agendamentos;
